import { Component } from "react";
import OpenClose from '../../img/Extends.svg';
import './Nav.css';


export default class Nav extends Component{

    state={
        toggleMenu : false,
        screenWidth : window.innerWidth
    }

    toggleNav = () => {
        this.setState({toggleMenu : !this.state.toggleMenu})
    }

    scroll=(y)=>{
        window.scrollY(y);
    }

    render(){
        return(
            <header>
                <a id="aNav" href='/'>
                    <h1>Analie Flórez Sánchez</h1>
                    <h2>Desarrollo Full Stack</h2>
                </a>
                <nav className="navBar">    
                <button onClick={this.toggleNav} id="btnNavBar"><img src={OpenClose} alt='Extends button'></img></button>
                    {(this.state.screenWidth>1060 || this.state.toggleMenu)&&

                   <ul className='icons'>
                       <a >
                        <li onClick={this.scroll(0)} className='ListNav'><h1>Sobre Mí</h1> </li>
                        </a>
                        <a href="#Formacion">
                        <li className='ListNav'><h1>Formación</h1></li>
                        </a>
                        <a href="#Lenguajes">
                        <li className='ListNav'><h1>Lenguajes</h1></li>
                        </a>
                        <a href="#Competencias">
                        <li className='ListNav'><h1>Competencias</h1></li>
                        </a>
                        <a href="#Experiencia">
                        <li className='ListNav'><h1>Experiencia</h1></li>
                        </a>
                    </ul>}
                </nav>

            </header>
        )
    }
}
